ControlPropertyState.AutoRuleBindingString:
Switch(
    Self.Selected.ItemKey,
    "tile",
    Refresh(LastMile),
    "Back",
    Back(),
    "Return",
    UpdateContext({Colreturn: true}),
    "Post",
    If(
        PowerAppsOneGrid2_1.Selected.Attempt = 3,
        Notify(
            "Reached Attempt Limit",
            NotificationType.Error
        ),
        Concurrent(
            Set(
                lastmileselc,
                PowerAppsOneGrid2_1.Selected
            ),
            Set(
                barcodeidd,
                First(
                    Filter(
                        'Invoice Out',
                        ID = 7
                    )
                )
            )
        );
        Set(
            taskassingg,
            Createothertasktooken.Run(
                Concatenate(
                    PowerAppsOneGrid2_1.Selected.Title,
                    "_",
                    PowerAppsOneGrid2_1.Selected.'Order No',
                    "-",
                    Text(barcodeidd.Title)
                ),
                LookUp(
                    LastMile,
                    Title = PowerAppsOneGrid2_1.Selected.Title && 'Order No' = PowerAppsOneGrid2_1.Selected.'Order No'
                ).'Receiver Name',
                teamidd.'User ID',
                teamidd.'Team ID',
                Text(
                    Today(),
                    "yyyy-mm-dd"
                ),
                LookUp(
                    LastMile,
                    Title = PowerAppsOneGrid2_1.Selected.Title && 'Order No' = PowerAppsOneGrid2_1.Selected.'Order No'
                ).ReceiverPhoneNumber,
                LookUp(
                    LastMile,
                    Title = PowerAppsOneGrid2_1.Selected.Title && 'Order No' = PowerAppsOneGrid2_1.Selected.'Order No'
                ).'Receiver Address',
                1,
                PowerAppsOneGrid2_1.Selected.Title
            ).res
        );
        Notify(
            "task created",
            NotificationType.Success
        );
        Concurrent(
            UpdateIf(
                'Invoice Out',
                ID = 7,
                {Title: Sum(barcodeidd.Title + 1)}
            ),
            Patch(
                LastMile,
                lastmileselc,
                {
                    'Tookan ID': taskassingg,
                    'New AWB': Text(barcodeidd.Title),
                    h: lastmileselc.h & "<li>  <div Style='position: relative;
  margin: 0 0 20px 20px;
  padding: 10px;
  background: #333;
  color: gray;
  border-radius: 8px;
  max-width: 400px;'>
<h3 Style='color: orangered; position: relative;'> Re-Assigned </h3>

     <ol>
     <li>At  " & Now() & "</li>
     <li>Tookan ID  " & taskassingg & "</li>
     <li> Fleet " & Driverinfoo.'User Name' & "</li>
     <ol>
     </div>
     </li>

"
                }
            )
        )
    ),
    "Delete",
    Remove(
        'Hold Orders',
        LookUp(
            'Hold Orders',
            Title = PowerAppsOneGrid2_1.Selected.Title && 'Order No' = PowerAppsOneGrid2_1.Selected.'Order No'
        )
    ),
    "OrderList",
    Navigate('LastMile Orders'),
    "Print",
    Set(
        lastmileawbprint,
        PowerAppsOneGrid2_1.Selected
    );
    Set(
        logooo,
        JSON(
            Image13.Image,
            JSONFormat.IncludeBinaryData
        )
    );
    Set(
        Invoic,
        invoiceflow.Run(
            Concatenate(
                "AWB",
                "_",
                PowerAppsOneGrid2_1.Selected.'Order No'
            ),
            HtmlText11_3.HtmlText
        ).invoiceeeeeee
    );
    Download("https://spacefulfillmentsolutions.sharepoint.com/sites/Test/Downloads/" & Invoic),
    "info",
    UpdateContext({historyview: true})
)
